" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Clofazimine: International drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F10830630\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Clofozine (IN);",
"     </li>",
"     <li>",
"      Hansepran (IN);",
"     </li>",
"     <li>",
"      Lamcoin (TH);",
"     </li>",
"     <li>",
"      Lampren (JP, NL, ES);",
"     </li>",
"     <li>",
"      Lamprene (AU, CH, CZ, FR, GR, HK, IR, MY, NZ, SA, UK);",
"     </li>",
"     <li>",
"      MB-Combi (SA)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list synlist drugH1Div drugBrandNames\" id=\"F10830631\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Index Terms",
"    </span>",
"    <ul>",
"     <li>",
"      B-663;",
"     </li>",
"     <li>",
"      Clofazimina;",
"     </li>",
"     <li>",
"      Clofazimine;",
"     </li>",
"     <li>",
"      Clofaziminum;",
"     </li>",
"     <li>",
"      G-30320;",
"     </li>",
"     <li>",
"      Klofatsimiini;",
"     </li>",
"     <li>",
"      Klofatzimin;",
"     </li>",
"     <li>",
"      Klofaziminos;",
"     </li>",
"     <li>",
"      NSC-14106",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F10830632\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Antibiotic, Miscellaneous",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F10830633\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Labeled: Hansen's Disease (leprosy): Treatment of severe erythema nodosum leprosum (ENL) reactions in multibacillary (MB) leprosy",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Off-label/Investigational: Rarely used as treatment of multidrug resistant tuberculosis (MDR-TB) and in",
"     <i>",
"      Mycobacterium avium",
"     </i>",
"     complex (MAC) complex infections in patients with acquired immune deficiency symptoms (AIDS)",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F10830635\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral: Leprosy:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Children: 2 mg/kg every other day (in combination with dapsone and rifampin)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Adults: 50 mg/day (in combination with dapsone and rifampin) for 24 months",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821256\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     International: No longer available commercially. In nations where a national leprosy elimination program exists, the Ministries of Health make an official request to the World Health Organization (WHO) for clofazimine. In nations where no such program exists, doctors or pharmacists from individual institutions contact the WHO with a request. A request can be made to the WHO via a letter, fax, or email to verify that the drug will be used to treat a severe ENL reaction due to leprosy and how many patients need the drug. If these conditions are met, a free supply of clofazimine will then be made available. For treatment of MDR-TB, the WHO handles decisions regarding distribution on an individual case-by-case basis. For additional information: file://www.who.int/lep/mdt/clofazimine/en/.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     United States: Clofazimine is distributed through the National Hansen&rsquo;s Disease Program (NHDP). NHDP holds the Investigational New Drug (IND) clofazimine for treatment in the United States. In order for physicians to obtain clofazimine, they will have to register as an investigator under the NHDP IND. This will require submitting a curriculum vitae and a signed FDA form 1572 to the NHDP. For further information, or to request investigator status, please call the NHDP at 1-800-642-2477. For additional information: file://www.hrsa.gov/hansens/clinical/regimens.htm.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F10830636\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Capsule, oral: 50 mg, 100 mg",
"    </p>",
"   </div>",
"  </div>",
