" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Sodium hypochlorite solution: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?29/20/30019?source=see_link\">",
"    see \"Sodium hypochlorite solution: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F221802\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Atrapro&trade; Dermal;",
"     </li>",
"     <li>",
"      Dakin's Solution;",
"     </li>",
"     <li>",
"      Di-Dak-Sol",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F221814\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Disinfectant, Antibacterial, Topical",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F221803\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Disinfectant:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Atrapro&trade; Dermal spray: Topical: Apply to affected area 3 times daily.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Dakin&rsquo;s solution, Di-Dak-Sol:  Topical via irrigation:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Lightly-to-moderately exudative wounds: Apply once daily.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Highly exudative or contaminated wounds: Apply twice daily.",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F221810\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F221804\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F221794\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Dakin's Solution: 0.125% (473 mL); 0.25% (473 mL); 0.5% (473 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Di-Dak-Sol: 0.0125% (473 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, topical [spray]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Atrapro&trade; Dermal: 0.004% (236 mL)",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F221783\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F221796\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     For external use only; do",
"     <b>",
"      not",
"     </b>",
"     ingest. Protect intact skin with a moisture barrier ointment or skin sealant as needed.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F221795\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Atrapro&trade; Dermal (0.004%): Management (via debridement) of wounds such as stage I-IV pressure ulcers; partial and full thickness wounds; diabetic foot ulcers; post surgical and donor sites; first- and second-degree burns",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Dakin&rsquo;s Solution (0.125%, 0.25%, 0.5%); Di-Dak-Sol (0.0125%): Prevention/treatment of skin and tissue infections, cuts, abrasions, skin ulcers; pre- and postsurgery",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F12769484\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Administration issues:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       A potential for confusion associated with labeling of strengths for Dakin&rsquo;s solution manufactured by Century Pharmaceuticals exists. The labels list strengths as full strength at 0.5%, half strength at 0.25%, and quarter strength at 0.125%. This terminology is confusing to healthcare providers who consider half strength and quarter strength to correspond to 0.5% and 0.25%, respectively. Of note, most hospitals use a modified Dakin&rsquo;s solution of 0.025% for wound care; studies have suggested that concentrations of Dakin&rsquo;s solution &gt;0.025% may potentially be harmful for wound healing.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F221812\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Dermatologic: Irritating to skin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Hematologic: Dissolves blood clots, delays clotting",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F221798\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to any component of the formulation",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F221786\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
