"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 570px\">",
"   <div class=\"ttl\">",
"    Lungs in a healthy child",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 550px; height: 521px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is what the lungs of a healthy child look like. They sit on the left and right sides of the upper chest, inside the ribcage. When a child takes a breath, air comes in through the nose and mouth, goes down the throat, and into the main airway leading to the lungs called the \"trachea\". The trachea branches into the left and right bronchus, which carry air to each lung.",
