var content_f28_23_29048=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F64214&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F64214&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 638px\">",
"   <div class=\"ttl\">",
"    First step algorithm: The seven-level criterion ladder",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 618px; height: 733px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     Level 1:",
"    </strong>",
"    Melanocytic lesions criteria. a) Pigment network (exception: dermatofibroma); b) Negative network; c) Pseudonetwork (facial skin); d) Streaks; e) Parallel pigment pattern (acral lesions on palms and soles); f) Aggregated globules; g) Homogeneous blue pigmentation.",
"    <br>",
"     <strong>",
"      Level 2:",
"     </strong>",
"     Basal cell carcinomas criteria. a) Arborizing blood vessels; b) Spoke wheel-like structures; c) Leaf-like areas; d) Large blue-gray ovoid nests; e) Multiple non-aggregated blue-gray globules; f) Ulceration.",
"     <br>",
"      <strong>",
"       Level 3:",
"      </strong>",
"      Seborrheic keratosis criteria. a) Multiple (3 or more) milia-like cysts; b) Comedo-like openings; c) Gyri and sulci (fissures and ridges); d) Fingerprint-like structures; e) Moth-eaten borders.",
"      <br>",
"       <strong>",
"        Level 4:",
"       </strong>",
"       Hemangioma/angioma/angiokeratoma. a) Red lacunae; b) Blue lacunae; c) Black lacunae.",
"       <br>",
"        <strong>",
"         Level 5:",
"        </strong>",
"        Blood vessels as seen in non-melanocytic tumors. a) Arborizing vessels; b) Glomerular vessels; c) Hairpin vessels with white halo; d) Crown vessels; e) Serpiginous or string of pearls; f) \"Strawberry\" pattern.",
"        <br>",
"         <strong>",
"          Level 6:",
"         </strong>",
"         Blood vessels as seen in melanocytic tumors. a) Comma-shaped vessels; b) Dotted vessels; c) Serpentine vessels (or linear irregular); d) Corkscrew vessels; e) Polymorphous vessels; f) Milky-red areas.",
"         <br>",
"          <strong>",
"           Level 7:",
"          </strong>",
"          Structureless lesions. No structures or vessels noted.",
"          <div class=\"footnotes\">",
"          </div>",
"          <div class=\"reference\">",
"           Reproduced with permission from: Drs. Ashfaq Marghoob and Natalia Jaimes.",
"          </div>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
