var title_f28_23_29051="Coping with menopause PI";
var content_f28_23_29051=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F82045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F82045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Ways to cope with menopause symptoms",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Symptom",
"       </td>",
"       <td class=\"subtitle1\">",
"        What you can do",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Hot flashes and night sweats",
"       </td>",
"       <td>",
"        Dress in layers so you can take off clothes if you get hot.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Keep the thermostat down and avoid hot drinks, like coffee or tea.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Put a cold, wet washcloth against your neck during hot flashes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Quit smoking, if you smoke. (Smoking makes hot flashes worse.)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Vaginal dryness",
"       </td>",
"       <td>",
"        Use lubricants before sex.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use a vaginal moisturizer, such as Replens&reg; or Lubrin&reg;.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Keep in mind that having sex or masturbating can help keep the vagina healthy.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Sleep problems",
"       </td>",
"       <td>",
"        Go to sleep and get up at the same time every day, even when you don't sleep well. (Taking naps can make the problem worse.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid caffeine in the afternoon and don't drink much alcohol.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Depression",
"       </td>",
"       <td class=\"divider_top\">",
"        Try to stay active. Exercise helps ward off depression.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Seek social support from women like you.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
